insert into shteam2_db.NOTIFICATION (ID, TITLE, CONTENT, FILES, CREATED_DATE, USER_ID, STATUS)
values  ('1', 'Work Schedule 2', '{"ops":[{"insert":"A work schedule, also known as a work plan or work timetable, is a structured plan that outlines the hours and days an employee is expected to work. Work schedules can vary based on the organization''s needs, industry, and specific job roles. Here are some common types of work schedules:\\n"},{"attributes":{"color":"var(--tw-prose-bold)"},"insert":"Full-Time Work Schedule:"},{"attributes":{"list":"ordered"},"insert":"\\n"},{"insert":"Typically consists of 40 hours per week, divided into five 8-hour days."},{"attributes":{"indent":1,"list":"bullet"},"insert":"\\n"},{"insert":"Commonly follows a standard Monday to Friday workweek."},{"attributes":{"indent":1,"list":"bullet"},"insert":"\\n"},{"attributes":{"color":"var(--tw-prose-bold)"},"insert":"Part-Time Work Schedule:"},{"attributes":{"list":"ordered"},"insert":"\\n"},{"insert":"Involves fewer hours per week compared to full-time work."},{"attributes":{"indent":1,"list":"bullet"},"insert":"\\n"},{"insert":"Can vary widely, with employees working a few hours per day or several days a week."},{"attributes":{"indent":1,"list":"bullet"},"insert":"\\n"},{"attributes":{"color":"var(--tw-prose-bold)"},"insert":"Shift Work Schedule:"},{"attributes":{"list":"ordered"},"insert":"\\n"},{"insert":"Common in industries requiring 24/7 operations, such as healthcare and manufacturing."},{"attributes":{"indent":1,"list":"bullet"},"insert":"\\n"},{"insert":"Employees work in shifts, often including night and weekend shifts."},{"attributes":{"indent":1,"list":"bullet"},"insert":"\\n"},{"attributes":{"color":"var(--tw-prose-bold)"},"insert":"Flextime Schedule:"},{"attributes":{"list":"ordered"},"insert":"\\n"},{"insert":"Allows employees to choose their work hours within certain limits."},{"attributes":{"indent":1,"list":"bullet"},"insert":"\\n"},{"insert":"Provides flexibility to balance personal and work life."},{"attributes":{"indent":1,"list":"bullet"},"insert":"\\n"},{"attribu